window.bookSummaryJSON = "<p><b>The world teeters on the brink of destruction. </b></p> <p>The people who should be saving the Earth ignore Jason Asano's warnings and choose to loot the house as it burns down around them. He lacks the strength to save the world himself, but resolves to do it anyway, impossible be damned. </p> <p>The impossible, in this case, means seizing a power that no mortal should touch. It's a choice from which there is no turning back, and marks Jason's first step into a wider cosmos that he is not yet ready to face.</p> <p>Holding the fate of two worlds in his hands, Jason must decide for himself what home truly means.</p>"; 
